import React from "react";
import style from "./HeaderSimple.module.scss";
import { Link } from "react-router-dom";

const HeaderSimple = () => {
  return (
    <header className={style.header}>
      <Link className={style.backBtn} to="/"></Link>
    </header>
  );
};

export { HeaderSimple };
